    /**
     * @description: 自定义方法
     * @Param: [nums]
     * @Return: int
     * @Date: 2021/9/1 13:20
     */
    public static int findMaxConsecutiveOnes(int[] nums) {
        int max = 0;
        int count = 0;
        for (int num : nums) {
            if (num == 1) {
                count++;
            } else {
                if (count > max) {
                    max = count;
                }
                count = 0;
            }
        }
        if (count > max) {
            max = count;
        }
        return max;
    }


    /**
     * @description: 力扣官方题解
     * @Param: [nums]
     * @Return: int
     * @Date: 2021/9/1 13:21
     */
    public static int findMaxConsecutiveTwo(int[] nums) {
        int maxCount = 0, count = 0;
        int n = nums.length;
        for (int i = 0; i < n; i++) {
            if (nums[i] == 1) {
                count++;
            } else {
                maxCount = Math.max(maxCount, count);
                count = 0;
            }
        }
        maxCount = Math.max(maxCount, count);
        return maxCount;
    }

